import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import AnalysisBoard from './AnalysisBoard';
import EditBoard from './EditBoard';
import './styles.css';
import Chessboard from 'chessboardjsx';

const EditBoardPage = () => {
    return (
        <div className="landing-page">
            <header>
                <nav>
                    <ul>
                        <li><Link to="/">Home</Link></li>
                        <li className="features-dropdown">
                            <a href="#">Play</a>
                            <ul className="features-dropdown-menu">
                                <li><Link to="/play-stockfish">Play vs Stockfish</Link></li>
                            </ul>
                        </li>
                        <li><a href="#prepare">Prepare</a></li>
                        <li><a href="#study">Study</a></li>
                        <li className="features-dropdown">
                            <a href="#">Analyze</a>
                            <ul className="features-dropdown-menu">
                                <li><Link to="/analysis-board">AnalysisBoard</Link></li>
                            </ul>
                        </li>
                    </ul>
                </nav>
            </header>

            <main>
            <div style={boardsContainer}>

                    <EditBoard></EditBoard>

            </div>
            </main>

            <footer>
                <p>&copy; 2024 SquareChess. All rights reserved.</p>
            </footer>
        </div>
    );
};

export default EditBoardPage;

const boardStyle = {
    borderRadius: "5px",
    boxShadow: `0 5px 15px rgba(0, 0, 0, 0.5)`
};

const boardsContainer = {
    display: "flex",
    justifyContent: "space-around",
    alignItems: "center"
};
